    <header class="mb-8">
      <h1 class="text-4xl font-black text-primary mb-2">Solar-Flare Equinox</h1>
      <p class="text-accent text-lg mb-4 italic">Surviving the Desert of Light</p>
      <div class="h-2 bg-gradient-to-r from-primary/60 to-accent/60 rounded-full"></div>
    </header>

